import React, { Component } from "react";
import logo from "./logo.svg";
// import { ResizeProvider, ResizeConsumer } from "react-resize-context";
import { ResizableBox } from "react-resizable-and-movable";
import "./App.css";

class App extends Component {

    constructor(props) {
        super(props);
        this.state = { 
          apiResponse: "", 
          size: {}
        };
    }

    // handleSizeChanged = size => {
    //   this.setState({ size });
    // };

    callAPI() {
        fetch("http://localhost:6789/stocks")
            .then(res => res.text())
            .then(res => this.setState({ apiResponse: res }))
            .catch(err => err);
    }

    componentDidMount() {
        this.callAPI();
    }

    render() {
        return (
          <ResizableBox x={20} y={20} width={200} height={200} className="container">
              <div className="App">
                <h1>test</h1>
                {/* <p className="App-intro">{this.state.apiResponse}</p> */}
              </div>
            </ResizableBox>
          //  </ResizeProvider>
        );
    }
}

export default App;
